import React, { } from 'react';
import './SquarePanel.css';

function SquarePanel() {
  return (
    <div className="panel">
      <div className='title'>
        Hello!
      </div>
      <div className="small-panel">
        <p>This is a smaller panel.</p>
      </div>
    </div>
  );
}

export default SquarePanel;
